import { Button } from "..";

function Card({title, body}) {
    return (
        <div className="card">
            <div className="card-image">
            </div>
            <div className="card-title">
                {title}
            </div>
            <div className="card-body">
                <p>{body}</p>
            </div>
            <Button name="View Menu"/>
        </div>
    );
}

export default Card;
